B.Qo=new A.bP([B.jz,"A blinded creature can't see and automatically fails any ability check that requires sight. Attack rolls against the creature have advantage, and the creature's attack rolls have disadvantage.",B.jA,"A charmed creature can't attack the charmer or target the charmer with harmful abilities or magical effects. The charmer has advantage on any ability check to interact socially with the creature.",B.jQ,"A deafened creature can't hear and automatically fails any ability check that requires hearing.",B.jG,"Exhaustion is measured in six levels. An effect can give a creature one or more levels of exhaustion, as specified in the effect's description. See levels below for specific effects.\nLevel 1: Disadvantage on ability checks.\nLevel 2: Speed halved.\nLevel 3: Disadvantage on attack rolls and saving throws.\nLevel 4: Hit point maximum halved.\nLevel 5: Speed reduced to 0.\nLevel 6: Death.",B.jR,"A frightened creature has disadvantage on ability checks and attack rolls while the source of its fear is within line of sight. The creature can't willingly move closer to the source of its fear.",B.jS,"A grappled creature's speed becomes 0, and it can't benefit from any bonus to its speed. The condition ends if the grappler is incapacitated or if an effect removes the grappled creature from the reach of the grappler or grappling effect.",B.jT,"An incapacitated creature can't take actions or reactions.",B.jU,"An invisible creature is impossible to see without the aid of magic or a special sense. For the purpose of hiding, the creature is heavily obscured. The creature's location can be detected by any noise it makes or any tracks it leaves. Attack rolls against the creature have disadvantage, and the creature's attack rolls have advantage.",B.jV,"A paralyzed creature is incapacitated and can't move or speak. The creature automatically fails Strength and Dexterity saving throws. Attack rolls against the creature have advantage. Any attack that hits the creature is a critical hit if the attacker is within 5 feet of the creature.",B.jW,"A petrified creature is transformed, along with any nonmagical object it is wearing or carrying, into a solid inanimate substance (usually stone). Its weight increases by a factor of ten, and it ceases aging. The creature is incapacitated, can't move or speak, and is unaware of its surroundings. Attack rolls against the creature have advantage. The creature automatically fails Strength and Dexterity saving throws. The creature has resistance to all damage. The creature is immune to poison and disease, although a poison or disease already in its system is suspended, not neutralized.",B.jB,"A poisoned creature has disadvantage on attack rolls and ability checks.",B.jC,"A prone creature's only movement option is to crawl unless it stands up and thereby ends the condition. The creature has disadvantage on attack rolls. An attack roll against the creature has advantage if the attacker is within 5 feet of the creature. Otherwise, the attack roll has disadvantage.",B.jD,"A restrained creature's speed becomes 0, and it can't benefit from any bonus to its speed. Attack rolls against the creature have advantage, and the creature's attack rolls have disadvantage. The creature has disadvantage on Dexterity saving throws.",B.jE,"A stunned creature is incapacitated, can't move, and can speak only falteringly. The creature automatically fails Strength and Dexterity saving throws. Attack rolls against the creature have advantage.",B.jF,"An unconscious creature is incapacitated, can't move or speak, and is unaware of its surroundings. The creature drops whatever it's holding and falls prone. The creature automatically fails Strength and Dexterity saving throws. Attack rolls against the creature have advantage. Any attack that hits the creature is a critical hit if the attacker is within 5 feet of the creature.",B.fM,"While concentrating on a spell, a caster must maintain focus to continue the spell's effects. Taking damage requires a Constitution saving throw for each instance of damage to maintain concentration (DC = the highest between 10 and half the damage taken rounded down). The spell ends if the caster loses concentration, becomes incapacitated, or dies.",B.jH,"When a creature is baned, it must subtract 1d4 from any attack roll or saving throw it makes.",B.jI,"When a creature is blessed, it gains divine favor, allowing it to add 1d4 to any attack roll or saving throw it makes.",B.jJ,"When a creature is inspired, it has an extra reserve of resolve or creativity, represented by an inspiration die (typically a d6). The creature can roll this die and add the number rolled to one ability check, attack roll, or saving throw it makes, expending the inspiration in the process.",B.jK,"While under the effects of the mirror image spell, a creature creates illusory duplicates of itself that make it harder to be hit. Each time the creature is attacked, there is a chance the attack will strike a duplicate instead. The duplicates remain until destroyed or the spell ends.",B.jL,"When a creature is raging it gains advantage on Strength checks and saving throws, deals additional damage with melee weapon attacks, and takes less damage from non-magical attacks. The rage ends if the creature does not attack or take damage for a full round.",B.jM,"When a creature is protected by the sanctuary spell, any enemy attempting to attack or target it with a harmful spell must first succeed on a Wisdom saving throw. On a failure, the enemy must choose a new target or lose the action. The spell's effect is broken if the protected creature attacks or casts a spell that affects an enemy.",B.jN,"When a creature is on fire, it suffers ongoing burning damage each round at the start of its turn. The flames can be extinguished by the creature or another creature using an action to douse the flames, or through other means such as submersion in water or magical intervention. The creature remains ablaze until the fire is put out, potentially causing further damage and panic.",B.jO,"When a creature is holding an action, it has prepared a specific response to a triggering event. The creature declares what action it will take and what will trigger it. If the trigger occurs before the creature's next turn, it can use its reaction to execute the held action. If the trigger doesn't occur, the action is lost.",B.jP,"When a creature's reaction has been used, it can no longer take another reaction until the start of its next turn. This means the creature cannot make opportunity attacks, use spells like Counterspell or Shield, or respond to other triggers requiring a reaction until it regains its ability to do so."],A.a8("bP<cl,h>"))
